// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract PolygonForest is ERC721, Ownable {
  constructor() ERC721("PolygonForest", "FOREST")
  {}

  uint[] prices = [0, 0.001 ether, 0.01 ether, 0.035 ether];
  uint[] logsAdded = [0, 400, 2800, 10000];

  uint forestSize; // 1 log = 1 cent
  
  struct Tool {
    uint id;
    uint8 model;
    uint32 chopTime;
    uint8 logsPerChop;
    uint nextReady;
  }

  Tool[] tools;

  mapping (address => uint) logBalance;

  // Game Functions
  function chop(uint _id) external {
    require(ownerOf(_id) == msg.sender, "You do not own this tool");

    Tool storage tool = tools[_id];
    require(block.timestamp >= tool.nextReady, "This tool is not ready");
    require(forestSize > 0, "There are no trees in the forest");

    tool.nextReady = block.timestamp + tool.chopTime;
    logBalance[msg.sender] += tool.logsPerChop;

    if (forestSize < tool.logsPerChop) {
      forestSize = 0;
    } else {
      forestSize -= tool.logsPerChop;
    }
  }

  function cashout() external payable {
    uint logs = logBalance[msg.sender];
    if (logs > 0) {
      uint ethPerLog = 0.0000025 ether;
      uint cashoutMoney = ethPerLog * logs;
      payable(msg.sender).transfer(cashoutMoney);
      logBalance[msg.sender] = 0;
    }
  }

  // Mint Functions
  function mint(uint8 _model, uint32 _chopTime, uint8 _logsPerChop) private {
    uint id = tools.length;

    Tool memory newTool = Tool(id, _model, _chopTime, _logsPerChop, block.timestamp);
    
    _safeMint(msg.sender, id);

    tools.push(newTool);
  }
  

  function mintTool(uint8 _model) external payable {
    require(_model >= 0 && _model < 4, "Model number is not valid");
    require(msg.value >= prices[_model], "Model price not paid");
    if (_model == 0) { // Hatchet
      mint(_model, 12 hours, 1);
    } else if (_model == 1) { // Axe, 
      mint(_model, 2 hours, 5);
    } else if (_model == 2) { // Saw
      mint(_model, 30 minutes, 2);
    } else if (_model == 3) { // Chainsaw
      mint(_model, 1 hours, 50);
    }
    forestSize += logsAdded[_model];
  }

  // Fetch Functions
  function getForestSize() external view returns (uint) {
    return forestSize;
  }

  function getTool(uint _id) external view returns (Tool memory) {
    require(_exists(_id), "This tool does not exist");
    return tools[_id];
  }

  function getOwnedTools(address _address) external view returns (Tool[] memory) {
    uint toolCount = balanceOf(_address);
    if (toolCount == 0) {
      return new Tool[](0);
    } else {
      Tool[] memory ownedTools = new Tool[](toolCount);
      uint toolsAdded = 0;
      for (uint i = 0; i < tools.length; i++) {
        if (ownerOf(i) == _address) {
          ownedTools[toolsAdded] = tools[i];
          toolsAdded++;
        }
      }
      return ownedTools;
    }
  }

  function getLogBalance() external view returns (uint) {
    return logBalance[msg.sender];
  }

  // Admin Functions
  function withdraw() external payable onlyOwner {
    address payable owner = payable(owner());
    owner.transfer(address(this).balance);
  }
}
